Locação de Espaço pare realização do 5º Congresso Regional de Psicologia que atenda, de forma integral, os seguintes requisitos mínimos necessários:
•	Auditório com capacidade para 50 (cinquenta) pessoas;
•	Duas Salas com capacidade para 25 (vinte e cinco) pessoas;
•	Cadeiras e Mesas devidamente equipadas, proporcionando conforto aos participantes;
•	Luz ambiente adequada para a ocasião, a ser providenciada pelo próprio espaço;
•	Equipamentos de som, microfone e data show no auditório e nas salas;
•	Sinal de Wi-Fi disponível e gratuito para todos os presentes do evento, com velocidade de no mínimo 100mb;
•	Banheiros;
•	Água e Café a ser providenciada pelo próprio espaço;
•	Serviço de Coffe Break para 50 (cinquenta) pessoas a serem servidos nos dois dias de evento, 21/03 e 22/03, em horário a definir;
•	Serviço de Alimentação (almoço) para 50 (cinquenta) pessoas no dia 22/03/2025 considerando a necessidade de otimização do tempo e rápida continuidade nos trabalhos, os profissionais de psicologia e colaboradores irão almoçar no próprio local, evitando deslocamento para fora do ambiente do evento e possibilitando o rápido retorno para continuidade dos trabalhos.
